import React from "react";
import {Link} from 'react-router-dom';
import style from './landing.module.css';
const Landing =()=>{
    return (
        <div className={style.body}>
            <Link to='/home'> 
            <button >Ingresar</button>
            </Link>
       
        </div>
    )

}


export default Landing;
